import { Fragment } from 'react';
import { Route, Switch } from 'react-router-dom';

import Login from './auth/login/Login';
import Navigation from './menu/Navigation';

const App = () => {
  return (
    <Fragment>
      <Navigation />
      <Switch>
        <Route path='/login'>
          <Login />
        </Route>
        <Route path='*'>
          <Login />
        </Route>
      </Switch>
    </Fragment>
  );
};

export default App;
